import './App.css';

function Button({ text, className = "Buttons-look" }) {
  return (
    <button className={className}>{text}</button>
  );
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Button text="7" />
        <Button text="8" />
        <Button text="9" />
        <Button text="4" />
        <Button text="5" />
        <Button text="6" />
        <Button text="1" />
        <Button text="2" />
        <Button text="3" />
        <Button text="0" />
        <Button text="+" />
        <Button text="-" />
        <Button text="*" />
        <Button text="/" />
        <Button text="%" />
        <Button text="=" />
      </header>
    </div>
  );
}

export default App;
